import React from 'react'
import ReactDom from 'react-dom'

function MainContent() {
  return (
    <main>
      <h1>Reasons why I am excited to be learning React</h1>
      <ul>
        <li>It was developed by Facebook, which is one of my dream organisation to work at</li>
        <li>It is a Frontend Javascript framework and I am a huge fan of technologies related to web development</li>
        <li>With React you can achieve a powerful web application by splitting up HTML codes into components which is mind blowing.</li>
      </ul>
    </main>
  )
}

ReactDom.render(
  <>
  <MainContent />
  </>, document.getElementById('root')
);
